import { createClient } from '@supabase/supabase-js'

const supabaseUrl = 'https://lmkknxrqzmtwiyulujei.supabase.co'
const supabaseKey = 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6Imxta2tueHJxem10d2l5dWx1amVpIiwicm9sZSI6ImFub24iLCJpYXQiOjE3MzA5Njg5OTksImV4cCI6MjA0NjU0NDk5OX0.Z8T1Cu2YVhfQFCsxfCDdJkmaI2FRp4fGVWt3tdXl9gU'

const supabase = createClient(supabaseUrl, supabaseKey)

// fetch data de la tabla prueba que esta en public

const fetchData = async () => {
    const { data, error } = await supabase
        .from('prueba')
        .select('*')
    console.log(data)

    if (error) {
        console.log('Error fetching data:', error.message)
    }
}



fetchData()


//ver los datos en html con return

const App = () => {
    return (
        <div>
            <h1>Supabase</h1>
        </div>
    )
}

export default App
